import React from "react";
import CardBtn from "../CardBtn";
import "./style.css";

function Card(props) {
  return (
    <div>
      <span style="color: #373737; line-height: 18px; font-family: Arial; font-size: 12px;">We are once again one of the 2019 Fortune 100 Best Companies to Work For. This is the 19th time Baptist Health has been named to the prestigious list. This recognition is based on employee ratings of their workplace culture, including the level of trust they feel towards leaders, the pride they take in their jobs and the camaraderie they experience with co-workers.</span>
    </div>
  );
}

export default Card;
